text_show:
1.Ka DSP2.Ntho e 'ngoe ea bohlokoa bakeng sa ho fokotsa maikutlo3.1U, e loketseng ho kenngoa ka har'a khabinete ea lisebelisoa
Lisebelisoa:
Likamore tsa liboka, Liholo tsa Kopano, Kereke, Liholo tsa Thuto, Liholo tse nang le mesebetsi e mengata joalo-joalo.
Likaroloana:
◆ Moralo o tloaelehileng oa chassis, 1U aluminium alloy panel, e loketseng ho kenya khabinete;
◆ Mochine o phahameng oa ts'ebetso ea DSP ea lisebelisoa tsa digital, 2-inch TFT color LCD skrine ho bontša maemo le mesebetsi ea ts'ebetso;
◆Algorithm e ncha, ha e hloke ho lokisa liphoso, sistimi ea phihlello e hatella lintlha tse llang, e nepahetseng, e tšepahalang ebile e bonolo ho e sebelisa;
◆ Algorithm e feto-fetohang ea mololi oa tikoloho, e nang le ts'ebetso ea sebaka sa de-reverberation, matlafatso ea molumo e ke ke ea phahamisa molumo sebakeng sa reverberation, 'me e na le mosebetsi oa ho hatella le ho felisa reverberation;
◆ Algorithm ea ho fokotsa lerata ea tikoloho, ts'ebetso e bohlale ea lentsoe, ho fokotsa Ts'ebetsong ea ho matlafatsa lentsoe, lerata leo e seng la motho le ka ntlafatsa kutloisiso ea puo le ho finyella ho tlosoa ka bohlale ha matšoao a lentsoe ao e seng a motho;

1) Moralo oa molala oa Swan: Moralo o bonolo oa probe, o ka bonang libaka tse nyane le tse thibetsoeng habonolo;
2)LCDponts'o: bonts'a ka mokhoa o hlakileng khatello ea khase e lekantsoeng, hlahloba kapele sebaka sa ho lutla;
3)E bonolosebetsaion: moralo oa konopo e le 'ngoe, ts'ebetso ea senotlolo se le seng, ho boloka nako le boiteko;
4) Kutlo e phahameng: e nang le sensor e sebetsang hantle, karabelo e potlakileng, le nako ea karabelo e tloaelehilengsebui sa khase se tukange ka tlase ho metsotsoana e 12;
5) Mefuta e fapaneng ea alamo: alamo ea leseli, alamo ea buzzer, alamo e bonts'ang skrineng le alamo ea vibrate;
6) Khetla e matsutla: e entsoe ka khetla ea ABS e sa sebetseng le e matla haholo, e tšoarellang mme e ka sebelisoa nako e telele.;
7) Mekhoa e 'meli ea ho kenya moea: phallo le ho huloa ha pompo li tšehetsoa ho fihlela litlhoko tsa ts'ebeliso ea maemo a fapaneng..
